        string RetornarNomeOrgao(string linha, string chave, string textoAtual)
        {
            var retorno = RetornarTextoTag(linha, chave, "", true, true, true);
            if (retorno.ToUpper() == retorno && RetornarTextoTag(linha, "\\([\\w]{1,10} - [0-9/]{10}\\) [0-9]{3,10}\\-[0-9]{3,10}\\-[a-z0-9]{5,20}", "") == "")
                return retorno;
            return textoAtual;
        }

        public void RetornarTextosSeparados(object caminho)
        {
            if (!File.Exists(caminho.ToString()))
                throw new Exception("Arquivo não encontrado");
            string textoArquivo = File.ReadAllText(caminho.ToString(), System.Text.Encoding.GetEncoding(ConfigurationManager.AppSettings["Encoding"]));
            textoArquivo = Regex.Replace(textoArquivo, "\r\n", "");
            textoArquivo = Regex.Replace(textoArquivo, "</p><div>", "</p>\r\n<div>");
            textoArquivo = Regex.Replace(textoArquivo, "</span><span", "</span>\r\n<span");
            textoArquivo = Regex.Replace(textoArquivo, "</p><p", "</p>\r\n<p");
            textoArquivo = Regex.Replace(textoArquivo, "<sup>", "");
            textoArquivo = Regex.Replace(textoArquivo, "</sup>", "");
            string[] linhas = textoArquivo.Split(new string[] { "\r\n" }, StringSplitOptions.RemoveEmptyEntries);
            var dtRetorno = new DataTable();

            string chaveMinisterio = "";
            string chaveOrgao = "";
            string chaveSubOrgao = "";
            string chaveCorpoLicitacao = "";
            string chaveTipoModalidade = "";
            string chaveTipoRegistro = "";

            string nomeMinisterio = "";
            string nomeOrgao = "";
            string nomeSubOrgao = "";
            string tipoModalidade = "";
            string tipoRegistro = "";
            string textoLicitacao = "";
            string textoLicitacoesCompleto = "";


            string nomeOrgaoGravacao = "";
            string nomeSubOrgaoGravacao = "";

            string chaveAux = "";

            chaveMinisterio = RetornarTextoTag(textoArquivo, "<span class=\"font[0-9]{1,5}\"( style=\"font-weight:bold;\"|)>(Sum[áa]rio|PRESIDÊNCIA DA REP[ÚU]BLICA CASA CIVIL IMPRENSA NACIONAL)</span>", "", false);
            chaveOrgao = RetornarTextoTag(textoArquivo, "<span class=\"font[0-9]{1,5}\"( style=\"font-weight:bold;\"|)>(CASA CIVIL|SECRETARIA EXECUTIVA|SECRETARIA DE ADMINISTRA[ÇC][ÃA]O).*</span>", "", false);
            chaveSubOrgao = RetornarTextoTag(textoArquivo, "<span class=\"font[0-9]{1,5}\"( style=\"font-weight:bold;\"|)>(IMPRENSA NACIONAL.*|SE( |)CRETARIA)</span>", "", false);
            chaveCorpoLicitacao = RetornarTextoTag(textoArquivo, "<span class=\"font[0-9]{1,5}\">P[ÁA]GINA</span>", "", false);
            chaveTipoModalidade = RetornarTextoTag(textoArquivo, "<span class=\"font[0-9]{1,5}\"( style=\"font-weight:bold;\"|)>*.*" + ChaveModalidadeProcurada + ".*</span>", "", false);
            chaveTipoRegistro = RetornarTextoTag(textoArquivo, "<span class=\"font[0-9]{1,5}\"( style=\"font-weight:bold;\"|)>*.*" + ChaveTipoRegistroProcurado + ".*</span>", "", false);

            //for (int i = 0; i < 100 && i < linhas.Length; i++)
            //{
            //    chaveMinisterio = RetornarTextoTag(linhas[i], "<span class=\"font[0-9]{1,5}\"( style=\"font-weight:bold;\"|)>Sum[áa]rio", chaveMinisterio, false);
            //    chaveOrgao = RetornarTextoTag(linhas[i], string.Format(chaveBusca, "{1,3}", "{", "}", "9", "\"Times New Roman\", serif"), chaveOrgao, false);
            //    chaveSubOrgao = RetornarTextoTag(linhas[i], string.Format(chaveBusca, "{1,3}", "{", "}", "9", "\"Times New Roman\", serif"), chaveSubOrgao, false);
            //    chaveTipoLicitacao = RetornarTextoTag(linhas[i], "<span class=\"font[0-9]{1,5}\">P[ÁA]GINA</span>", chaveTipoLicitacao, false);
            //    chaveTipoModalidade = RetornarTextoTag(linhas[i], "<span class=\"font[0-9]{1,5}\">P[ÁA]GINA</span>", chaveTipoModalidade, false);
            //}

            chaveMinisterio = Regex.Replace(chaveMinisterio, ">.+<", ">.+?<");
            chaveOrgao = Regex.Replace(chaveOrgao, ">.*<", ">.+?<");
            chaveSubOrgao = Regex.Replace(chaveSubOrgao, ">.*<", ">.+?<");
            chaveTipoModalidade = Regex.Replace(chaveTipoModalidade, ">.*<", ">*.*" + ChaveModalidadeProcurada + ".+?<");
            chaveTipoRegistro = Regex.Replace(chaveTipoRegistro, ">.*<", ">.+?<");
            chaveCorpoLicitacao = Regex.Replace(chaveCorpoLicitacao, ">.*<", ">.+?<");

            string strRetornoAux = "";
            bool boReiniciarOrgao = true;
            for (int i = 0; i < linhas.Length; i++)
            {
                if (SaltarLinha(linhas[i]))
                    continue;
                if (RetornarTextoTag(linhas[i], chaveMinisterio, "") != "")
                {
                    nomeMinisterio = RetornarTextoTag(linhas[i], chaveMinisterio, nomeMinisterio, true).Trim();
                    nomeOrgao = "";
                    nomeSubOrgao = "";
                }
                if (nomeMinisterio != "" && RetornarNomeOrgao(linhas[i], chaveOrgao, "") != "")
                {
                    if (boReiniciarOrgao)
                        nomeOrgao = "";
                    if (nomeOrgao != "")
                        nomeOrgao += "\r\n";
                    nomeOrgao += RetornarNomeOrgao(linhas[i], chaveOrgao, "");
                    nomeSubOrgao = "";
                }
                if (nomeOrgao != "")
                {
                    if (RetornarNomeOrgao(linhas[i], chaveSubOrgao, "") != "" && RetornarNomeOrgao(linhas[i], chaveSubOrgao, "") != RetornarNomeOrgao(linhas[i], chaveOrgao, ""))
                    {
                        if (boReiniciarOrgao)
                            nomeSubOrgao = "";
                        if (nomeSubOrgao != "")
                            nomeSubOrgao += "\r\n";
                        nomeSubOrgao += RetornarNomeOrgao(linhas[i], chaveSubOrgao, "");
                    }
                    tipoRegistro = RetornarTextoTag(linhas[i], chaveTipoRegistro, tipoRegistro, true);
                    textoLicitacao = RetornarTextoTag(linhas[i], chaveTipoModalidade, textoLicitacao, false);
                    if (textoLicitacao.Trim() != "" && RetornarTextoTag(linhas[i], chaveCorpoLicitacao, "") != "")
                    {
                        textoLicitacao = RetornarTextoTag(textoLicitacao, chaveTipoModalidade, "", true);
                        tipoModalidade = ModalidadeProcurada(textoLicitacao);
                        nomeOrgaoGravacao = nomeOrgao;
                        nomeSubOrgaoGravacao = nomeSubOrgao;
                        if (RetornarTextoTag(linhas[i], chaveTipoModalidade, "") != "")
                            i++;
                        string textoLicitacaoAux = "";
                        for (i = i; i < linhas.Length; i++)
                        {
                            if (SaltarLinha(linhas[i]))
                                continue;
                            textoLicitacaoAux = RetornarTextoTag(linhas[i], chaveCorpoLicitacao, "", false);
                            if (RetornarTextoTag(linhas[i], chaveTipoModalidade, "") != ""
                                || textoLicitacaoAux == ""
                                || RetornarNomeOrgao(linhas[i], chaveOrgao, "") != ""
                                 || RetornarNomeOrgao(linhas[i], chaveSubOrgao, "") != "")
                            {
                                if (RetornarTextoTag(linhas[i], chaveTipoModalidade, "", false) != "")
                                {
                                    textoLicitacaoAux = "";
                                }
                                if (RetornarNomeOrgao(linhas[i], chaveOrgao, "") != "")
                                {
                                    textoLicitacaoAux = "";
                                    nomeOrgao = "";
                                    nomeSubOrgao = "";
                                }
                                if (RetornarNomeOrgao(linhas[i], chaveSubOrgao, "") != "")
                                {
                                    textoLicitacaoAux = "";
                                    nomeSubOrgao = "";
                                }
                                if (RetornarTextoTag(linhas[i], chaveMinisterio, "") != "")
                                {
                                    textoLicitacaoAux = "";
                                    nomeMinisterio = "";
                                    nomeOrgao = "";
                                    nomeSubOrgao = "";
                                }
                                textoLicitacao += textoLicitacaoAux;
                                i--;
                                break;
                            }
                            else
                            {
                                textoLicitacao += RetornarTextoTag(textoLicitacaoAux, chaveCorpoLicitacao, "").Trim() + "\r\n";
                            }
                        }
                        if (textoLicitacao != "")
                        {
                            textoLicitacao += "".PadRight(150, '*');
                            textoLicitacoesCompleto += string.Format("Ministério: {0}\r\nÓrgão: {1}\r\nSub Órgão: {2}\r\nTipo Registro: {5}\r\nTipo Licitação: {3}\r\nTexto Licitação: {4}\r\n\r\n\r\n", nomeMinisterio, nomeOrgaoGravacao, nomeSubOrgaoGravacao, tipoModalidade, textoLicitacao, tipoRegistro).PadLeft(150, '*');
                        }
                        textoLicitacao = "";
                        tipoModalidade = "";
                        boReiniciarOrgao = true;
                        tipoRegistro = "";
                    }
                }
            }
            try
            {
                File.WriteAllText(caminho + ".txt", textoLicitacoesCompleto, Encoding.GetEncoding("utf-8"));
            }
            catch (Exception)
            {

            }
            //return dtRetorno;
        }

