        #region Quebrar Arquivo Licitações

        public DataTable RetornarLicitacaoQuebrada(string textoArquivoLicitacao)
        {
            var dtRetorno = this.dtLicitacao.Clone();
            string[] licitacoes = textoArquivoLicitacao.Split(new string[] { "".PadLeft(150, '*') }, StringSplitOptions.RemoveEmptyEntries);
            codigoLicitacao = 0;
            for (int i = 0; i < licitacoes.Length; i++)
            {
                if (licitacoes[i].Trim() != "")
                {
                    string textoLicitacaoEntrada = Regex.Replace(licitacoes[i], "\r\n", " ").Trim();
                    string strModalidade = ModalidadeProcurada(textoLicitacaoEntrada, false);
                    if (!strModalidade.Contains(","))
                    {
                        dtRetorno.Merge(RetornarLicitacaoQuebradaUmRegistro(textoLicitacaoEntrada));
                    }
                    else if (strModalidade.Contains(","))
                    {
                        dtRetorno.Merge(RetornarLicitacaoQuebradaMaisRegistros(textoLicitacaoEntrada));
                    }
                }
            }
            return dtRetorno;
        }

        DataTable RetornarLicitacaoQuebradaUmRegistro(string textoLicitacao)
        {
            var dtRetorno = this.dtLicitacao.Clone();
            textoLicitacao = textoLicitacao.Replace("\r\n", " ").Trim();
            string texto = Alcos.Util.Gerais.RemoverDuploEspaco(textoLicitacao);
            string textoSubstituir = "";
            while ((textoSubstituir = RetornarTextoTag(texto, "[a-z]{1,50}-[ ]{1,5}", "")) != "")
            {
                texto = texto.Replace(textoSubstituir, textoSubstituir.Replace("- ", ""));
            }
            if (ModalidadeProcurada(texto) != "" && ModalidadeIgnorada(textoLicitacao) == "")
            {
                textoLicitacao = TratarTextoLicitacao(texto);
                string strModalidade = ModalidadeProcurada(textoLicitacao);
                var linha = dtRetorno.NewRow();
                dtRetorno.Rows.Add(linha);
                linha[campoCodigoLicitacao] = ++codigoLicitacao;
                linha[campoTipoModalidade] = strModalidade;


