        DataTable RetornarLicitacaoQuebradaMaisRegistros(string textoLicitacao)
        {
            var textoLicitacaoArray = textoLicitacao.Split(new string[] { "\r\n" }, StringSplitOptions.RemoveEmptyEntries);
            string textoLicitacaoSemEnter = Regex.Replace(textoLicitacao, "\r\n", " ").Trim();
            string textoLicitacaoLocal = Regex.Replace(textoLicitacao, "\r\n", " ").Trim();
            var licitacaoSeparada = new List<string>();
            var dtRetorno = this.dtLicitacao.Clone();
            var textoLicitacaoAux = "";
            //var textoValidaVariasLicitacoes = "relativ(o|a)(s|) ([aà]|o)(s|) {0}|torna(m|) p[úu]blico o(s|) resultado(s|) (d(o|a)(s|) (julgamento(s|)|licita[çc]([ãa]o)|[õo]es)|) ";
            var textoValidaVariasLicitacoes = "relativ(o|a)(s|) ([aà]|o)(s|) {0}|torna(m|) p[úu]blico o(s|) resultado(s|) (d(o|a)(s|) (julgamento(s|)|licita[çc]([ãa]o)|[õo]es)|apresentadas na {0}|) ";
            string strModalidade = "";
            string cabecalho = "";
            string numeroModalidadeAnterior = "";
            string modalidadeNumero = "";
            int i = 0;
            for (i = 0; i < textoLicitacaoArray.Length; i++)
            {
                strModalidade = ModalidadeProcurada(textoLicitacaoArray[i]);
                modalidadeNumero = RetornarTextoTag(textoLicitacaoArray[i], strModalidade + chaveNumeroLicitacaoInicio + chaveNumeroLicitacaoFinal, "");
                if (modalidadeNumero == "")
                {
                    cabecalho += textoLicitacaoArray[i] + " ";
                }
                else
                {
                    if (textoLicitacaoArray[i].Trim() != modalidadeNumero.Trim())
                    {
                        if (!textoLicitacaoArray[i].Trim().StartsWith(modalidadeNumero.Trim()))
                            cabecalho += textoLicitacaoArray[i].Trim().Substring(0, textoLicitacaoArray[i].Trim().IndexOf(modalidadeNumero)) + " ";
                    }
                    break;
                }
            }

            textoLicitacaoLocal = "";
            for (; i < textoLicitacaoArray.Length; i++)
            {
                textoLicitacaoLocal += " " + textoLicitacaoArray[i].Trim();
            }
            string[] arrModalidades = ModalidadeProcurada(textoLicitacaoLocal, false).Split(',');
            if (arrModalidades.Length > 1)
            {
                var numerosModalidades = new List<string>();
                int indiceInicio = 0;
                int indiceFim = 0;
                numeroModalidadeAnterior = "";
                for (i = 0; i < arrModalidades.Length; i++)
                {
                    arrModalidades[i] = arrModalidades[i].Trim();
                    modalidadeNumero = RetornarTextoTag(textoLicitacaoLocal.Substring(indiceInicio), arrModalidades[i] + chaveNumeroLicitacaoInicio + chaveNumeroLicitacaoFinal, "");
                    indiceInicio = textoLicitacaoLocal.IndexOf(modalidadeNumero, indiceInicio) + modalidadeNumero.Trim().Length;
                    if (modalidadeNumero == "" || RetornarTextoTag(modalidadeNumero.Substring(arrModalidades[i].Length), "\\d+", "") == "")
                        continue;
                    if (modalidadeNumero != ""
                        && !numeroModalidadeAnterior.Trim().StartsWith(arrModalidades[i], StringComparison.InvariantCultureIgnoreCase)
                        && FormatarNumeroLicitacaoComparacao(numeroModalidadeAnterior.Replace(arrModalidades[i], "")) != FormatarNumeroLicitacaoComparacao(modalidadeNumero.Replace(arrModalidades[i], "")))
                    {
                        numeroModalidadeAnterior = modalidadeNumero;
                        numerosModalidades.Add(modalidadeNumero);
                    }
                }
                var arTexto = new List<string>();
                var boCopiado = true;
                textoLicitacaoAux = "";
                indiceInicio = 0;
                indiceFim = 0;
                for (i = 0; i < numerosModalidades.Count; i++)
                {
                    indiceInicio = textoLicitacaoLocal.IndexOf(numerosModalidades[i], indiceFim);
                    if (indiceInicio > -1)
                    {
                        if (i == numerosModalidades.Count - 1)
                        {
                            textoLicitacaoAux += textoLicitacaoLocal.Substring(indiceInicio);
                            boCopiado = true;
                        }
                        else
                        {
                            indiceFim = textoLicitacaoLocal.IndexOf(numerosModalidades[i + 1], indiceInicio);
                            string textoTemporario = "";
                            if (indiceFim > indiceInicio)
                            {
                                textoTemporario = textoLicitacaoLocal.Substring(indiceInicio, indiceFim - indiceInicio);
                            }
                            else
                            {
                                textoTemporario = textoLicitacaoLocal.Substring(indiceInicio);
                            }
                            if (RetornarTextoTag(textoTemporario, string.Format(textoValidaVariasLicitacoes, numerosModalidades[i]), "") != "")
                            {
                                boCopiado = true;
                            }
                            textoLicitacaoAux += textoTemporario;
                        }
                        if (boCopiado)
                        {
                            licitacaoSeparada.Add(cabecalho + " " + textoLicitacaoAux);
                            textoLicitacaoAux = "";
                        }
                    }
                }
            }
            else
            {
                licitacaoSeparada.Add(textoLicitacaoSemEnter);
            }
            if (licitacaoSeparada.Count > 0)
            {
                for (i = 0; i < licitacaoSeparada.Count; i++)
                {
                    dtRetorno.Merge(RetornarLicitacaoQuebradaUmRegistro(licitacaoSeparada[i]));
                }
            }
            else
            {
                dtRetorno.Merge(RetornarLicitacaoQuebradaUmRegistro(textoLicitacaoSemEnter));
            }
            return dtRetorno;
        }

        string FormatarNumeroLicitacaoComparacao(string texto)
        {
            var i = 0;
            texto = Alcos.Util.Gerais.RemoverDuploEspaco(texto.Trim()).Replace("-", "").Replace(" ", "").Replace("&deg;", "").Replace(".", "");
            while (i < texto.Length)
            {
                if (!texto.StartsWith("0"))
                {
                    break;
                }
                texto = texto.Remove(0, 1);
            }
            return texto;
        }

        string FormatarNumeroLicitacao(string texto)
        {
            var i = 0;
            texto = Alcos.Util.Gerais.RemoverDuploEspaco(texto.Trim()).Replace("&deg;", "").Replace(".", "").Replace(" ", "").Replace("Nº", "").Replace("º", "");
            if (texto.StartsWith("o-", StringComparison.InvariantCultureIgnoreCase) || texto.StartsWith("n2", StringComparison.InvariantCultureIgnoreCase))
            {
                texto = texto.Remove(0, 2);
            }
            while (i < texto.Length)
            {
                if (!texto.StartsWith("0") && !texto.StartsWith("-") && !texto.StartsWith(".") && !texto.StartsWith("o") && !texto.StartsWith("n", StringComparison.InvariantCultureIgnoreCase))
                {
                    break;
                }
                texto = texto.Remove(0, 1);
            }
            return texto;
        }

        string FormatarNomeModalidade(string texto)
        {
            texto = texto.Trim();
            string textoProcurado = RetornarTextoTag(Alcos.Util.Gerais.RemoverDuploEspaco(texto.Trim()), "(n-|n -|N -)", "");
            if (textoProcurado == "")
                textoProcurado = RetornarTextoTag(Alcos.Util.Gerais.RemoverDuploEspaco(texto), "(N)", "");
            if (textoProcurado != "" && texto.EndsWith(textoProcurado))
                texto = texto.Remove(texto.Length - textoProcurado.Length).Trim();
            return texto;
        }

