        void PreencherEnderecoPostal(string textoLicitacao, DataRow linha)
        {
            string chaveEstadosComplemento = string.Format("([/\\.\\(-]| do | de )( |){0}[\\./&, -]", chaveEstados);
            string chaveEnderecoPostalInicio = "(sediad[ao](s|)|situad[ao](s|)|localizad[ao](s|)|sede|Endere[çc]o|local|Edita(l|is)|contato|sito|consulta(r|s|))( |:|,|)";
            string chaveEnderecoPostal = chaveEnderecoPostalInicio + ".*" + chaveEstadosComplemento;
            string chaveEnderecoPostalSoEndereco = "(rua|avenida|r\\.|av\\.|estrada|viela|beco|\\bBR\\b [0-9]{3}|" + chaveEstados + " [0-9]{3}).*([/\\.\\(-]| do | de )( |)" + chaveEstados;
            string textoEndereco = RetornarTextoTag(textoLicitacao, chaveEnderecoPostal, "").Trim();
            while (textoEndereco != "" && RetornarTextoTag(textoEndereco.Substring(1), chaveEnderecoPostal, "").Trim() != "")
            {
                textoEndereco = RetornarTextoTag(textoEndereco.Substring(1), chaveEnderecoPostal, "").Trim();
            }
            while (textoEndereco != "" && RetornarTextoTag(textoEndereco.Substring(0, textoEndereco.Length - 1), chaveEnderecoPostalSoEndereco, "").Trim() != "")
            {
                textoEndereco = RetornarTextoTag(textoEndereco.Substring(0, textoEndereco.Length - 1), chaveEnderecoPostalSoEndereco, "").Trim();
            }
            while (textoEndereco != "" && RetornarTextoTag(textoEndereco.Substring(1), chaveEnderecoPostalSoEndereco, "").Trim() != "")
            {
                textoEndereco = RetornarTextoTag(textoEndereco.Substring(1), chaveEnderecoPostalSoEndereco, "").Trim();
            }
            while (textoEndereco.Trim() != "" && RetornarTextoTag(textoEndereco.Substring(1), "(site|www|@)", "").Trim() != "")
            {
                textoEndereco = RetornarTextoTag(textoEndereco.Substring(1), chaveEnderecoPostal, "").Trim();
            }
            while (textoEndereco.Trim() != "" && (RetornarTextoTag(textoEndereco.Substring(1), chaveData, "").Trim() != "" || RetornarTextoTag(textoEndereco.Substring(1), chaveHora, "").Trim() != ""))
            {
                textoEndereco = RetornarTextoTag(textoEndereco.Substring(1), chaveEnderecoPostal, "").Trim();
            }


            string textoEstado = "";
            string textoReferencia = "";
            int contador = 0;
            while (textoEstado == "" && contador <= 1 && textoReferencia != textoLicitacao)
            {
                contador++;
                if (textoEndereco == "")
                    textoReferencia = textoLicitacao;
                else
                {
                    if (RetornarTextoTag(textoEndereco, chaveEnderecoPostalInicio, "") != "")
                        textoEndereco = textoEndereco.Replace(RetornarTextoTag(textoEndereco, chaveEnderecoPostalInicio, ""), "");
                    textoReferencia = textoEndereco;
                }
                textoEstado = RetornarTextoTag(textoReferencia, string.Format("(((do|no|) Estado |)(no|do|de|em|da)( |(-/)( |))|[-/&](| )){0}[-./&, ]", chaveEstados), "", false, false).Trim();
                textoEstado = RetornarTextoTag(string.Format(" {0} ", textoEstado.Replace(",", " , ")), string.Format("{0}", chaveEstados), "", false, false).Trim();
                if (textoEstado == "")
                {
                    textoEstado = RetornarTextoTag(string.Format(" {0} ", textoReferencia), chaveEstadosComplemento, "", false, false).Trim();
                    textoEstado = RetornarTextoTag(string.Format(" {0} ", textoEstado), string.Format("{0}", chaveEstados + "[-./&, ]"), "", false, false).Trim();
                }
                if (textoEstado.Length == 2 && textoEstado.ToUpper() != textoEstado)
                {
                    textoEstado = "";
                }
                else if (textoEstado.Contains(","))
                {
                    string[] arrTextoEstado = textoEstado.Split(',');
                    for (int i = 0; i < arrTextoEstado.Length; i++)
                    {
                        if (arrTextoEstado[i].Trim().Length > 1 && (arrTextoEstado[i].Trim().Length > 2 || arrTextoEstado[i].Trim().ToUpper() == arrTextoEstado[i].Trim()))
                        {
                            textoEstado = arrTextoEstado[i].Trim();
                            break;
                        }
                    }
                    if (textoEstado.Contains(","))
                        textoEstado = "";
                }
            }

            textoEstado = Alcos.Util.Gerais.RemoverDuploEspaco(Alcos.Util.Gerais.RetiraCaracteresEspeciais(textoEstado.ToUpper(), false, false, true)).Trim();
            if (hsEstado.Contains(textoEstado))
            {
                textoEstado = hsEstado[textoEstado].ToString();
            }

            linha[campoEndereco] = textoEndereco.Trim();
            linha[campoNomeEstado] = textoEstado.Trim();
        }

