        void PreencherObjetoLicitacao(string textoLicitacao, DataRow linha)
        {
            string textoProcurado = "Objeto: ";
            int posicaoInicial = textoLicitacao.IndexOf(textoProcurado);
            int posicaoFinal = -1;
            if (posicaoInicial > -1)
            {
                posicaoInicial += textoProcurado.Length;
                textoProcurado = RetornarTextoTag(textoLicitacao, "(\\bO\\b|\\.|,) (Edital)(:|)", "");
                if (textoProcurado != "")
                    posicaoFinal = textoLicitacao.IndexOf(textoProcurado, posicaoInicial);
                posicaoFinal -= posicaoInicial;

            }
            if (posicaoInicial < 0)
                posicaoInicial = 0;
            if (posicaoFinal < 0)
                posicaoFinal = textoLicitacao.Length - posicaoInicial;
            textoProcurado = "Texto Licitação: ";
            linha[campoTextoLicitacao] = textoLicitacao.Substring(textoLicitacao.IndexOf(textoProcurado) + textoProcurado.Length);
            if (posicaoInicial == 0)
                linha[campoObjetoLicitacao] = linha[campoTextoLicitacao];
            else
                linha[campoObjetoLicitacao] = textoLicitacao.Substring(posicaoInicial, posicaoFinal);

        }

        string TratarTextoLicitacao(string textoLicitacao)
        {
            string modalidade = ModalidadeProcurada(textoLicitacao);
            if (modalidade != "")
            {
                string numeroLicitacaoCompleto = RetornarTextoTag(textoLicitacao, modalidade + chaveNumeroLicitacaoInicio + chaveNumeroLicitacaoFinal, "").Trim();
                string numeroLicitacao = "";
                numeroLicitacao = FormatarNumeroLicitacao(numeroLicitacaoCompleto.ToString().Replace(modalidade, "").Trim());
                modalidade = FormatarNomeModalidade(modalidade);
                string textoSubstituir = numeroLicitacaoCompleto.Replace(modalidade, "").Replace(numeroLicitacao, "");
                //if (textoSubstituir != "")
                //    textoLicitacao = textoLicitacao.Replace(textoSubstituir, " Nº ");
                textoLicitacao = textoLicitacao.Replace("&deg;.", "º").Replace("&deg;", "º").Replace("&quot;", "\"").Replace("&sect;", "§").Replace("&amp;", "&").Replace("°", "º");
            }
            return textoLicitacao;
        }

