        bool SaltarLinha(string linha)
        {
            string regProcura = "<span class=\"font\\d{1,3}\">\\d{1,3}</span>";
            regProcura += "|<span class=\"font\\d{1,3}\"><[ib]>\\d{1,3}</[ib]></span>";
            regProcura += "|<span class=\"font\\d{1,3}\">Di[áa]rio Oficial da Uni[ãa]o(&nbsp;| |)(-|)(&nbsp;| |)</";
            regProcura += "|>\\w{4}\\s\\d{4}-\\d{4}(&nbsp;| |)</";
            regProcura += "|<span class=\"font\\d{1,3}\">N&deg; \\d{3}, \\w{5,10}-feira, \\d{1,2} de \\w{4,10} de \\d{4}(&nbsp;| |)<";
            regProcura += "|<span class=\"font\\d{1,3}\">Este documento pode ser verificado no endereço eletr[ôo]nico(&nbsp;| |)<";
            regProcura += "|<span class=\"font\\d{1,3}\">Documento assinado digitalmente conforme MP n(&nbsp;| |)*.*que institui a Infraestrutura de Chaves Públicas Brasileira*.*</";
            regProcura += "|<span class=\"font\\d{1,3}\">(<b>|)(- |)Se[çc][ãa]o\\s{0,1}(\\d{1,3}|)(</b>|)(&nbsp;| |)</span>";
            return Regex.IsMatch(linha, regProcura, RegexOptions.IgnoreCase);
        }

