        string ModalidadeProcurada(string linha)
        {
            return ModalidadeProcurada(linha, true);
        }

        string ModalidadeProcurada(string linha, bool procurarSomentePrimeira)
        {
            if (procurarSomentePrimeira)
            {
                return Regex.Match(linha, ChaveModalidadeProcurada, RegexOptions.IgnoreCase).Value;
            }
            else
            {
                string texto = "";
                var retornos = Regex.Matches(linha, ChaveModalidadeProcurada, RegexOptions.IgnoreCase);
                for (int i = 0; i < retornos.Count; i++)
                {
                    texto += retornos[i].Value + ", ";
                }
                if (texto.Length > 1)
                {
                    texto = texto.Trim().Remove(texto.Trim().Length - 1);
                }
                return texto;
            }
        }

