            regProcura += "|Convoca[çc]([ãa]o|[õo]es) d(e|os) candidato(s|)";
            regProcura += "|Edita(l|is) d(e|as) Convoca[çc][ãa]o";
            regProcura += "|Aviso(s|) d(e|os) concurso(s|) p[úu]blico(s|)";
            regProcura += "|Aviso(s|) d(e|as) habilita[çc]([ãa]o|[õo]es)";
