        string FimPublicacao(string linha)
        {
            linha = linha.Trim().ToUpper();
            string regProcura = "\\(\\w+\\s\\-\\s\\d{2}\\/\\d{2}\\/\\d{4}\\)\\s\\d{6}\\-\\d{5}\\-\\d{4}\\w{2}\\d{6}";
            return Regex.Match(linha, regProcura).Value;
        }

        string RetornarTextoTag(string linha, string tag, string tagFechamento, string textoAtual)
        {
            string texto = Alcos.Util.Texto.RetornarTextoHTML(linha, tag, tagFechamento);
            if (texto != "")
            {
                return texto;
            }
            return textoAtual;
        }

        string RetornarTextoTag(string linha, string tag, string textoAtual)
        {
            return RetornarTextoTag(linha, tag, textoAtual, true);
        }

        string RetornarTextoTag(string linha, string tag, string textoAtual, bool limparTagHTML)
        {
            return RetornarTextoTag(linha, tag, textoAtual, limparTagHTML, true);
        }

        string RetornarTextoTag(string linha, string tag, string textoAtual, bool limparTagHTML, bool somentePrimeiro)
        {
            return RetornarTextoTag(linha, tag, textoAtual, limparTagHTML, somentePrimeiro, false);
        }
        string RetornarTextoTag(string linha, string tag, string textoAtual, bool limparTagHTML, bool somentePrimeiro, bool caseInsesitive)
        {
            return RetornarTextoTag(linha, tag, textoAtual, limparTagHTML, somentePrimeiro, caseInsesitive, false);
        }
        string RetornarTextoTag(string linha, string tag, string textoAtual, bool limparTagHTML, bool somentePrimeiro, bool caseInsesitive, bool Multilinha)
        {
            string texto = "";
            var regOptions = RegexOptions.IgnoreCase;
            if (caseInsesitive)
                regOptions = RegexOptions.None;
            if (Multilinha)
                regOptions = regOptions | RegexOptions.Multiline;

            if (somentePrimeiro)
            {
                texto = Regex.Match(linha, tag, regOptions).Value;
            }
            else
            {
                var retornos = Regex.Matches(linha, tag, regOptions);
                for (int i = 0; i < retornos.Count; i++)
                {
                    texto += retornos[i].Value + ", ";
                }
                if (texto.Length > 1)
                {
                    texto = texto.Trim().Remove(texto.Trim().Length - 1);
                }
            }
            if (limparTagHTML && texto.Trim() != "")
            {
                texto = Alcos.Util.Gerais.RemoverFormatacaoHTML(texto);
            }
            if (texto != "")
            {
                return texto;
            }
            return textoAtual;
        }

