        public DataSet RetornarLicitacaoOrgaoSegmentoPreenchido(DataTable dtRegistros)
        {
            dtRegistros.Columns.Add(campoCodigoOrgao);
            dtRegistros.Columns.Add(campoNomeOrgaoBanco);
            //dtRegistros.Columns.Add(campoCodigoLicitacao);
            dtRegistros.Columns.Add(campoTextoLicitacaoIndexado);
            dtRegistros.Columns.Add(campoNomeOrgaoIndexado);
            dtRegistros.Columns.Add(campoNomeSubOrgaoIndexado);
            var dsRetorno = new DataSet();

            for (int i = 0; i < dtRegistros.Rows.Count; i++)
            {
                dtRegistros.Rows[i][campoTextoLicitacaoIndexado] = " " + Alcos.Util.Gerais.RemoverDuploEspaco(Alcos.Util.Gerais.RetiraCaracteresEspeciais(dtRegistros.Rows[i][campoTextoLicitacaoCompleta].ToString().Replace("ões", "ao").Replace("ão", "ao").Replace("oes", "ao").Replace("ç", "c"), false, false, true)) + " ";
                dtRegistros.Rows[i][campoNomeOrgaoIndexado] = " " + Alcos.Util.Gerais.RemoverDuploEspaco(Alcos.Util.Gerais.RetiraCaracteresEspeciais(dtRegistros.Rows[i][campoNomeOrgao].ToString().Replace("ões", "ao").Replace("ão", "ao").Replace("oes", "ao").Replace("ç", "c"), false, false, true)) + " ";
                dtRegistros.Rows[i][campoNomeSubOrgaoIndexado] = " " + Alcos.Util.Gerais.RemoverDuploEspaco(Alcos.Util.Gerais.RetiraCaracteresEspeciais(dtRegistros.Rows[i][campoNomeSubOrgao].ToString().Replace("ões", "ao").Replace("ão", "ao").Replace("oes", "ao").Replace("ç", "c"), false, false, true)) + " ";
            }

            var dtSegmentoRetorno = this.dtSegmento.Clone();
            var dtOrgaoRetorno = this.dtOrgao.Clone();
            var dtSegmentoConsulta = RetornarSegmentoConsulta();
            var dtOrgaoConsulta = RetornarOrgaoConsulta();
            dtOrgaoRetorno.Merge(RetornarCodigoOrgaos(dtRegistros, dtOrgaoConsulta));
            dtSegmentoRetorno.Merge(RetornarCodigoSegmentos(dtRegistros, dtSegmentoConsulta));
            dsRetorno.Merge(dtOrgaoRetorno);
            dsRetorno.Merge(dtSegmentoRetorno);
            return dsRetorno;
        }

