        DataTable RetornarCodigoOrgaos(DataTable dtRegistros, DataTable dtOrgaosConsulta)
        {
            var dtRetorno = dtOrgao.Clone();
            var dtOrgaoConsultaLocal = dtOrgaosConsulta.Copy();
            var dtRegistrosLocal = dtRegistros.Copy();
            for (int i = 0; i < dtOrgaoConsultaLocal.Rows.Count; i++)
            {
                dtOrgaoConsultaLocal.Rows[i][campoNomeOrgao] = " " + Alcos.Util.Gerais.RemoverDuploEspaco(Alcos.Util.Gerais.RetiraCaracteresEspeciais(dtOrgaoConsultaLocal.Rows[i][campoNomeOrgao].ToString().Replace("ões", "ao").Replace("ão", "ao").Replace("oes", "ao").Replace("ç", "c"), false, false, false)) + " ";
            }
            for (int n = 0; n < dtRegistrosLocal.Rows.Count; n++)
            {
                string filtro = "";
                string palavrasFiltro = "";
                string filtroEstado = "";

                var texto = dtRegistrosLocal.Rows[n][campoNomeSubOrgaoIndexado].ToString();
                texto = Regex.Replace(texto, " " + chaveEstados + " ", "", RegexOptions.IgnoreCase);

                var palavras = texto.Split(new string[] { " " }, StringSplitOptions.RemoveEmptyEntries);
                if (palavras.Length == 0)
                {
                    texto = dtRegistrosLocal.Rows[n][campoNomeOrgaoIndexado].ToString();
                    texto = Regex.Replace(texto, " " + chaveEstados + " ", "", RegexOptions.IgnoreCase);
                    palavras = texto.Split(new string[] { " " }, StringSplitOptions.RemoveEmptyEntries);
                }
                if (palavras.Length > 0)
                {
                    for (int i = 0; i < palavras.Length; i++)
                    {
                        if (!IgnorarPalavraRowFilterNomeOrgao(palavras[i]))
                        {
                            if (filtro != "")
                                filtro += " AND ";
                            filtro += string.Format("{0} LIKE '% {1} %' ", campoNomeOrgao, palavras[i].Trim());
                            palavrasFiltro += palavras[i].Trim() + ",";
                        }
                    }

                    if (filtro != "")
                    {

                        if (dtRegistrosLocal.Rows[n][campoNomeEstado].ToString() != "")
                        {
                            filtroEstado = string.Format("AND ({0} = '{1}')", campoNomeEstado, dtRegistrosLocal.Rows[n][campoNomeEstado].ToString());
                        }
                        //dtOrgaoConsultaLocal.DefaultView.RowFilter = string.Format("({0}) OR ({1})", filtro, filtroSubOrgao);
                        dtOrgaoConsultaLocal.DefaultView.RowFilter = string.Format("({0}) {1}", filtro, filtroEstado);
                        for (int i = 0; i < dtOrgaoConsultaLocal.DefaultView.Count; i++)
                        {
                            dtRetorno.Rows.Add(dtRegistrosLocal.Rows[n][campoCodigoLicitacao], dtOrgaoConsultaLocal.DefaultView[i][campoCodigoOrgao], dtOrgaoConsultaLocal.DefaultView[i][campoNomeOrgao], dtOrgaoConsultaLocal.DefaultView[i][campoNomeEstado] + " *************** " + palavrasFiltro);
                        }
                        if (dtOrgaoConsultaLocal.DefaultView.Count > 1)
                            dtRegistros.Rows[n][campoCodigoOrgao] = 99999999;
                        else if (dtOrgaoConsultaLocal.DefaultView.Count == 1)
                            dtRegistros.Rows[n][campoCodigoOrgao] = dtOrgaoConsultaLocal.DefaultView[0][campoCodigoOrgao];
                    }
                }
            }
            return dtRetorno;
        }

        bool IgnorarPalavraRowFilterNomeOrgao(string palavra)
        {
            if (RetornarTextoTag(palavra, chaveEstados, "") != "" && RetornarTextoTag(palavra, chaveEstados, "") == palavra)
            {
                return true;
            }

            switch (palavra.Trim().ToLower())
            {
                case "de":
                case "dos":
                case "do":
                case "da":
                case "das":
                case "o":
                case "a":
                case "e":
                case "os":
                case "as":
                case "para":
                case "/":
                case ":":
                case "em":
                case "na":
                case "no":
                case "nas":
                case "nos":
                case "municipal":
                case "municipio":
                case "estado":
                    return true;
                default:
                    return false;
            }
        }

        DataTable RetornarCodigoSegmentos(DataTable dtRegistros, DataTable dtSegmentoConsulta)
        {
            var dtRetorno = dtSegmento.Clone();
            var dtSegmentoConsultaLocal = dtSegmentoConsulta.Copy();
            var dtRegistrosLocal = dtRegistros.Copy();
            for (int i = 0; i < dtSegmentoConsultaLocal.Rows.Count; i++)
            {
                dtSegmentoConsultaLocal.Rows[i][campoPalavraChaveSegmento] = Alcos.Util.Gerais.RemoverDuploEspaco(Alcos.Util.Gerais.RetiraCaracteresEspeciais(dtSegmentoConsultaLocal.Rows[i][campoPalavraChaveSegmento].ToString().Replace("ões", "ao").Replace("ão", "ao").Replace("oes", "ao").Replace("ç", "c"), false, false, false));
            }
            for (int n = 0; n < dtSegmentoConsultaLocal.Rows.Count; n++)
            {
                var palavras = dtSegmentoConsultaLocal.Rows[n][campoPalavraChaveSegmento].ToString().Split(new string[] { "," }, StringSplitOptions.RemoveEmptyEntries);
                if (palavras.Length > 0)
                {
                    string filtro = "";
                    string palavrasFiltro = "";
                    for (int i = 0; i < palavras.Length; i++)
                    {
                        if (filtro != "")
                            filtro += " OR ";
                        filtro += string.Format("{0} LIKE '% {1} %' ", campoTextoLicitacaoCompleta, palavras[i].Trim());
                        palavrasFiltro += palavras[i].Trim() + ",";
                    }
                    dtRegistrosLocal.DefaultView.RowFilter = filtro;
                    for (int i = 0; i < dtRegistrosLocal.DefaultView.Count; i++)
                    {
                        dtRetorno.Rows.Add(dtRegistrosLocal.DefaultView[i][campoCodigoLicitacao], dtSegmentoConsultaLocal.Rows[n][campoCodigoSegmento], dtRegistrosLocal.Rows[n][campoTextoLicitacaoCompleta], palavrasFiltro);
                    }
                }
            }
            return dtRetorno;
        }

        #endregion
    }
